(1, '45cadb45-cd9e-498f-b934-0669ac101b4e', 'Classic White T-Shirt', 2, 'CT-01', 'This classic white t-shirt is a wardrobe staple. Made from high-quality cotton, it features a relaxed fit and a ribbed crew neckline. Wear it with jeans and sneakers for a casual look or dress it up with a blazer and trousers.', 1, NULL, 'active', '2023-04-25 10:56:49', '2023-04-25 10:56:49'),
(2, '13715ae8-75cd-40cd-ad21-ebd3b4135651', 'Graphic Print T-Shirt', 2, 'GP-02', 'Make a statement with this graphic print t-shirt. The bold design features a mix of colors and textures, making it a unique addition to your wardrobe. The cotton fabric is soft and comfortable, while the regular fit provides a relaxed look.', 1, NULL, 'active', '2023-04-25 10:56:52', '2023-04-25 10:56:53'),
(3, 'b639af78-f553-4209-b21f-1f15b5109fb6', 'Vintage Wash T-Shirt', 2, 'VW-03', 'Get a cool, vintage look with this washed t-shirt. The cotton fabric has been treated for a worn-in, soft feel, and the regular fit provides a relaxed look. Pair it with your favorite jeans for an effortless, casual outfit.', 1, NULL, 'active', '2023-04-25 10:56:54', '2023-04-25 10:56:54'),
(4, 'a02a673d-dadd-4de0-9de5-07e56d63883a', 'Nike Air Max 90', 3, 'nike-air-max-90', 'The Nike Air Max 90 is a classic sneaker that features a durable leather and mesh upper, visible Max Air cushioning in the heel, and a rubber outsole for traction and durability. This shoe has a timeless design and is perfect for both casual wear and athletic activities.', 0, NULL, 'active', '2023-04-25 10:56:55', '2023-04-25 10:56:55'),
(5, 'e974c3d7-d1d3-4f38-90ee-623ca1b6577c', 'Adidas Ultraboost 21', 3, 'adidas-ultraboost-21', 'The Adidas Ultraboost 21 is a high-performance running shoe that features an advanced cushioning system and a lightweight yet durable construction. The shoe is designed to provide maximum comfort and support for runners of all levels.', 0, NULL, 'active', '2023-04-25 10:56:56', '2023-04-25 10:56:56'),
(6, '803237e9-e1ad-4aba-bb14-44c9f106b49a', 'Levi\'s 501 Jeans', 7, 'levis-501-jeans', 'The Levi\'s 501 is an iconic pair of jeans that features a classic straight leg, a button fly, and a timeless design. The jeans are made from high-quality denim and are built to last, making them a great choice for anyone looking for a durable and stylish pair of pants.', 0, NULL, 'active', '2023-04-25 10:56:56', '2023-04-25 10:56:56'),
(7, '7cb5148e-e1a0-4560-9cba-ef9d86d68f95', 'Cotton T-Shirt', 2, 'CT1001', 'A comfortable and breathable cotton t-shirt, perfect for casual wear. Comes in multiple colors.', 1, NULL, 'active', '2023-04-25 10:56:57', '2023-04-25 10:56:57'),
(8, '2ae065b3-b2b0-4236-a59e-14154365d816', 'Denim Jeans', 7, 'DJ2001', 'A classic pair of denim jeans, suitable for any occasion. Comes in various sizes and styles.', 0, NULL, 'active', '2023-04-25 10:56:58', '2023-04-25 10:56:58'),
(9, '9e7d6b42-2b36-4b20-845c-a79af3c3a4dd', 'Leather Jacket', 8, 'LJ3001', 'A stylish and durable leather jacket, perfect for colder weather. Available in multiple colors.', 0, NULL, 'active', '2023-04-25 10:56:59', '2023-04-25 10:56:59'),
(10, 'a9e6611e-1fca-41ec-9fb8-069cc5095d12', 'Red T-Shirt', 2, 'rt001', 'This red t-shirt is made from high-quality cotton and is incredibly comfortable. It is perfect for everyday wear and will keep you looking stylish.', 1, NULL, 'active', '2023-04-25 10:57:00', '2023-04-25 10:57:00'),
(11, '5f0a6cf2-6c2b-4a04-a444-687710346455', 'Leather Shoes', 3, 'ls001', 'These leather shoes are perfect for formal occasions. They are made from high-quality leather and are extremely comfortable to wear.', 0, NULL, 'active', '2023-04-25 10:57:01', '2023-04-25 10:57:01'),
(12, '3e825325-9736-4a3a-ba66-26425230baaa', 'Blue Jeans', 7, 'bj001', 'These blue jeans are made from high-quality denim and are incredibly comfortable. They are perfect for casual wear and will keep you looking stylish.', 1, NULL, 'active', '2023-04-25 10:57:02', '2023-04-25 10:57:02'),
(13, '686303a3-6644-445d-a157-529e1b893735', 'iPhone 13 Pro', 1, 'iphone_13_pro', 'The iPhone 13 Pro features a ProMotion display with a 120Hz refresh rate, a new A15 Bionic chip, and a triple-camera system with improved low-light performance. With support for 5G, Face ID, and a durable Ceramic Shield front cover, this phone is ready for anything.', 0, NULL, 'active', '2023-04-25 10:57:03', '2023-04-25 10:57:03'),
(14, '14de6169-1bc2-41a3-8eb1-359c205b6874', 'Samsung Galaxy S21', 1, 'samsung_galaxy_s21', 'The Samsung Galaxy S21 features a 6.2-inch AMOLED display, a Snapdragon 888 chipset, and a triple-camera system with up to 64MP resolution. With 5G support, an in-display fingerprint sensor, and Samsung Pay, this phone offers advanced features in a sleek and durable package.', 0, NULL, 'active', '2023-04-25 10:57:04', '2023-04-25 10:57:04'),
(15, '68cb2a5e-a244-43a8-bd45-8d3dcddb407a', 'Sony PlayStation 5', 1, 'sony_playstation_5', 'The Sony PlayStation 5 is the latest gaming console from Sony, with support for ray tracing, 4K resolution, and up to 120fps gameplay. With a custom AMD Zen 2 CPU and RDNA 2 GPU, this console delivers stunning graphics and lightning-fast performance.', 0, NULL, 'active', '2023-04-25 10:57:06', '2023-04-25 10:57:06'),
(16, '0ad4d348-ac0f-4024-91a9-532ad9149eb2', 'MAC Cosmetics Matte Lipstick', 6, 'mac_matte_lipstick', 'The MAC Cosmetics Matte Lipstick is a creamy, richly pigmented lipstick that provides bold, full coverage. It has a long-lasting, matte finish that won\'t dry out your lips. Available in a range of shades to complement any skin tone and outfit.', 0, NULL, 'active', '2023-04-25 10:57:07', '2023-04-25 10:57:07'),
(17, 'edcecb25-365b-4f11-905b-72ddc07ff348', 'LOreal Paris Voluminous Original Mascara', 6, 'loreal_voluminous_mascara', 'The LOreal Paris Voluminous Original Mascara is a volumizing and lengthening mascara that delivers bold and dramatic lashes. The formula is smudge-proof and flake-proof, and the unique brush design makes it easy to apply. Suitable for all eye types.', 0, NULL, 'active', '2023-04-25 10:57:09', '2023-04-28 13:28:14'),
(20, 'fe46ea25-13d3-417b-b87a-e79f48462b39', 'Test', 1, '01982301', 'asd', 1, NULL, 'active', '2023-04-28 13:31:50', '2023-04-28 13:33:48'),
(21, '932aedf6-3045-4250-99ca-e17d03bc3337', 'Elegant Watch Original', 5, 'Watch1123', 'A watch is a timepiece worn on the wrist or carried in a pocket, designed to keep time with great accuracy. It typically consists of a display face, which may show the time, date, and other features, and a mechanism that keeps the time. Watches can be analog, digital, or a combination of both, and are often made of materials such as stainless steel, leather, or plastic. They can also include features like GPS, fitness tracking, and waterproofing, and come in a range of styles from classic to modern.', 0, NULL, 'active', '2023-04-30 23:28:55', '2023-05-02 23:37:04'),
