(340, 'b9a4e692-9412-4fbd-8b72-23305719008e', 'vivo X80 pro 5G phone 256GB New Hot 50MP Back Camera', 1, 'VIVOPRO', 'About this item\r\nZeiss Professional Imaging: Equipped with a 50 MP ultra-sensing GNV sensor. The entire X80 Pro is equipped with Zeiss optics. All lenses meet ZEISS T* coating standards, which reduce light reflection and thus scattered light, so you can capture the world clear, vivid and in real colours.\r\nSharp display: a 6.78 inch curved 3D display with up to 120 Hz refresh frequency. AMOLED display. The resolution of 3200 x 1440 pixels adapts to the needs of users and optimises the power consumption of the display.\r\nLarge battery + wireless flashcharge: with the large 4700 mAh battery (TYP) and the improved 80 W wired flashcharge, the X80 Pro ensures that the exciting experience does not stop. Alternatively, you can also place it on a Vivo wireless charger and easily enjoy the wireless 50W flashCharge.\r\nSnapdragon 8 Gen 1:vivo X80 Pro is equipped with the Qualcomm Snapdragon 8 Gen1 processor, which greatly improves the performance of mobile phones. The also improved Adreno730 graphics processor delivers nearly 20% higher performance, delivering both a trouble-free basic experience and impressive peak performance. Stream videos, play games or multitasking - completing everyday tasks is a breeze.\r\nLarge 3D Ultrasonic Fingerprint Sensor: The X80 Pro features a large 3D ultrasonic fingerprint sensor whose scan area is 11.1 times larger than conventional one-point fingerprint sensors. To register a fingerprint, just press once and you\'re done. The X80 Pro offers excellent cooling thanks to the large extra-large liquid cooling steam chamber.\r\n2-year warranty', 1, NULL, 'active', '2023-05-06 09:58:43', '2023-05-06 09:58:43'),
