(361, '46d48f1a-ddbf-4dcb-bb70-6ffb430a10e6', '2021 World Premiere OnePlus Nord CE 5G EB2103 Smartphone', 1, 'ONEPLUSNORD', '4500mAh large battery\r\nNordCE5G is equipped with a 4500mAh large-capacity battery, allowing your phone to last longer.\r\n64MP main camera\r\nNordCE5G is equipped with a three-camera setup, including a high-resolution 64MP main camera (16MP higher than the original Nord). The large aperture/1.79 of the main camera can help you capture more light and details, even in low-light conditions.\r\n5G ready\r\n5Grings has higher network speed and lower network latency. The speed of downloading movies and music is 10 times that of 4G. 1g movies can be completed in 10 seconds, and video chatting is like face to face.\r\nWarpCharge30TPlus\r\nA bigger battery is worthy of a better charger. WarpCharge30TPlus has improved power transmission, and it only takes 30 minutes to change the high-capacity battery of Nord CE from 0 to 70%³.\r\nFast and smooth\r\nWhether scrolling, sliding or streaming, our 90Hz refresh rate can provide more than 50% visual information\r\nEvery second is an intoxicating and smooth experience.\r\nQualcomm®Snapdragon™ 750G5G MobilePlatformusesitsonboardAIto\r\nPowerful advanced processing, incredible graphics and 5G gaming. Coupled with up to 12GB of RAM to ensure that each application is fast and smooth.\r\nLight and pure\r\n170g+7.9mm+3.5mm headphone jack', 1, NULL, 'active', '2023-05-06 16:16:50', '2023-05-06 16:16:50');
