(385, 'acec3f96-86e4-4d81-afa7-c9df849748ae', 'Headset over-ear Wired Game Earphones Gaming Headphone', 1, 'HEADSET', 'About this item\r\n【Multi-Platform Compatible】Support PlayStation 4, New Xbox One, PC, Nintendo 3DS, Laptop, PSP, Tablet, iPad, Computer, Mobile Phone. Please note you need an extra Microsoft Adapter (Not Included) when connect with an old version Xbox One controller.\r\n【Surrounding Stereo Subwoofer】Clear sound operating strong brass, splendid ambient noise isolation and high precision 40mm magnetic neodymium driver, acoustic positioning precision enhance the sensitivity of the speaker unit, bringing you vivid sound field, sound clarity, shock feeling sound. Perfect for various games like Halo 5 Guardians, Metal Gear Solid, Call of Duty, Star Wars Battlefront, Overwatch, World of Warcraft Legion, etc.\r\n【Noise Isolating Microphone】Headset integrated onmi-directional microphone can transmits high quality communication with its premium noise-concellng feature, can pick up sounds with great sensitivity and remove the noise, which enables you clearly deliver or receive messages while you are in a game. Long flexible mic design very convenient to adjust angle of the microphone.\r\n【Great Humanized Design】Superior comfortable and good air permeability protein over-ear pads, muti-points headbeam, acord with human body engineering specification can reduce hearing impairment and heat sweat.Skin friendly leather material for a longer period of wearing. Glaring LED lights desigend on the earcups to highlight game atmosphere.\r\n【Effortlessly Volume Control】High tensile strength, anti-winding braided USB cable with rotary volume controller and key microphone mute effectively prevents the 49-inches long cable from twining and allows you to control the volume easily and mute the mic as effortless volume control one key mute.\r\nNote: Products with electrical plugs are designed for use in the US. Outlets and voltage differ internationally and this product may require an adapter or converter for use in your destination. Please check compatibility before purchasing.', 1, NULL, 'active', '2023-05-07 15:05:43', '2023-05-07 15:05:43'),
(386, '9d4c4273-5080-4208-9893-a37babc6e7a0', 'Manufacturers provide mini camera wifi white /black 4k action camera', 1, 'MINICAMERA', 'Types Of\r\nMirrorless cameras\r\nScreen Size\r\n3‘’\r\nMemory Card Type\r\nSD CARD\r\nBattery Type\r\nRechargeable Battery Pack\r\nVideo Function\r\nYes\r\nColour\r\nWhite Black\r\nCountry Of Origin\r\nMalaysia\r\nAnti-shake Function\r\nYes\r\nOptical Zoom\r\n2x - 7x\r\nHd Camera\r\n4k\r\nPixel\r\n> 20.0MP', 1, NULL, 'active', '2023-05-07 15:31:35', '2023-05-07 15:31:35'),
(387, '3d22781b-7255-4bd7-ab73-e3f394830925', 'Hot Selling 100% Origin Razer Kraken BT Kitty Wire', 1, 'RAZERKRAKEN', 'About this item\r\nOfficially licensed Hello Kitty and Friends: Reimagined with a heart of gold! Freshly baked with Razer Chroma RGB and a burst of stream-reactive lighting, this licensed headset is the perfect companion for those who speak from the heart\r\nBluetooth 5.0: When not in Gaming Mode, its wireless connection remains just as stable and uses less power—meaning the headset can last up to 20 hours with lighting on, or up to 50 hours with the lighting off\r\n40ms Low Latency Connection: Activate Gaming Mode to boost the headset’s wireless performance during competitive games, and be quicker to aim or react with audio and video that’s even more in sync\r\nCustom-Tuned 40mm Drivers: At its core, the headset provides a rich audio experience that increases your gaming enjoyment, pushing out clear trebles and midrange as well as deep, impactful bass\r\nBeamforming Microphone: With a sweet spot for voice that’s designed to pick up less noise from every other direction, the mic has no problems helping you sound as good as you look\r\nNote: Products with electrical plugs are designed for use in the US. Outlets and voltage differ internationally and this product may require an adapter or converter for use in your destination. Please check compatibility before purchasing.', 1, NULL, 'active', '2023-05-07 15:40:14', '2023-05-07 15:40:14'),
(388, '5c296af7-2f58-4348-b1cb-b1d98ccf56aa', 'P47 Super Bass TWS 2022 5.1 Headphone P47 Audifono', 1, 'P47', 'About this item\r\nWith the new Bluetooth 5.0 technology ensures fast and stable connections to your Bluetooth devices with low latency during audio/video streaming. No more worries about audio dropouts during phone calls and music listening.\r\nWired and Wireless Listening: Not just a pair of wireless bluetooth headphones, you can even connect these headphones to any device using a 3.5mm cable to enjoy non-stop music listening even when the battery runs out.\r\nFoldable Headphones and TF Card: This headphone is able to fold up to make it more compact and easy to carry. Having the TF card slot lets you put in a SD memory card with music inside the headphones to listen to them to make it a MP3 player headset.\r\nDeep Bass Function: This wireless headphones with 40mm drivers with deep bass function deliver playback with superb bass depth and HD clarity.\r\nAge range description: Adult\r\nCompatible devices: iphone, android, ipad, bluetooth, mac, windows', 1, NULL, 'active', '2023-05-07 15:48:22', '2023-05-07 15:48:22'),
