(395, 'e087bcd5-7f07-4d76-8ae4-563f1f796da4', '100% Original Lenovo Lp40 Wireless Headphones Touch', 1, 'LENOVOLP40', 'Overview: BT 5.0 technology offers high speed data transfer rate, stable performance and low power consumption. With TWS technology, you can only use headphones or use them in pairs. Equipped with a 300mAh charging box to store and charge your earphones. Built-in microphone provides clearer and more realistic sound. It will give you a perfect user experience.\r\nFeatures: BT 5.0 technology ensures higher data transfer rates, more stable and faster connection and lower power consumption. True dual-ear wireless design, left and right earphone channels are separated. Can be used alone or as a pair.\r\nTouch control design, no more pressure on your ears. Easy to control music and calls and activate voice assistant. Built-in microphone on both earphones with intelligent noise reduction provides clearer sound in stereo mode. A 300mAh charging case can charge and store your earphones. The 40mAh battery in each headset ensures about 3 hours of music.\r\nPackage List: 1 * Pair of Earbuds 1 * Charging Case 1 * Charging Cable 1 * User Manual (English / Chinese)', 1, NULL, 'active', '2023-05-07 16:56:05', '2023-05-07 16:56:05'),
(396, 'f2f61de3-e5b0-46ce-bcc5-8c2d9495279c', 'Hot Sales Original 1:1 for Max Wireless airpod', 1, 'MAXWIRELESSAIRPOD', 'About this item\r\n Apple-designed dynamic driver provides high-fidelity audio﻿\r\nActive Noise Cancellation blocks outside noise, so you can immerse yourself in music﻿\r\nTransparency mode for hearing and interacting with the world around you﻿\r\nSpatial audio with dynamic head tracking provides theater-like sound that surrounds you﻿\r\nComputational audio combines custom acoustic design with the Apple H1 chip and software for breakthrough listening experiences﻿\r\nDesigned with a knit-mesh canopy and memory foam ear cushions for an exceptional fit﻿\r\nMagical experience with effortless setup, on-head detection, and seamless switching between devices﻿\r\nEasily share audio between two sets of AirPods on your iPhone, iPad, iPod touch, or Apple TV﻿\r\n20 hours of listening, movie watching, or talk time with Active Noise Cancellation and spatial audio enabled﻿\r\nStore in ultra low-power mode with the slim Smart Case﻿', 1, NULL, 'active', '2023-05-07 17:00:58', '2023-05-07 17:00:58');
INSERT INTO `products` (`id`, `uuid`, `name`, `category_id`, `sku`, `description`, `is_variation`, `type`, `state`, `created_at`, `updated_at`) VALUES
(397, 'f0e3cffe-3bee-43f1-9530-b0861446234b', 'Beat Powerbeats Pro OriginaTWS BT Headphone Ture', 1, 'TWSBT', 'Overview\r\nHigh-performance workout earbuds\r\nPowerbeats Pro, powered by the Apple H1 headphone chip, will revolutionize the way you work out. Built for elite athletes, these true wireless earbuds have no wires to hold you back. The adjustable, secure-fit earhooks are customizable with multiple ear-tip options for extended comfort and are made to stay in place, no matter how hard you go. These lightweight earbuds are built for performance with a reinforced design for IPX4-rated sweat and water resistance, so you can take your workouts to the next level. With up to 9 hours of listening time in each earbud and powerful, balanced sound, you’ll always have your music to motivate you.\r\n\r\nSound like a pro\r\nWe listened to real athletes with the aim of designing bluetooth earbuds that matched their toughest workouts — and we heard over and over that sound was their top priority. Powerbeats Pro boast powerful, balanced audio thanks to an entirely redesigned acoustic package that delivers pure sound reproduction, enhanced clarity and improved dynamic range. Because great sound starts with proper fit, these earbuds were also crafted with a focus on ergonomic comfort to give you the best listening experience possible.\r\n\r\nPlay both sides or just one at a time\r\nLeft, right, or both, enjoy ultimate control over your audio. Each earbud has full volume and track controls so you don’t need your iPhone or other device to adjust your music. Auto Play/Pause sensors know when the earbuds are in your ear, jumpstarting your workouts as soon as you’re ready to go. And with voice-assistant capability on a variety of compatible devices, you can stay in the zone.\r\n\r\nPower. Play.\r\nLong hours of training? Marathons? Bring it. Each earbud has up to 9 hours of listening time so you can keep your music going. With the charging case, you’ll get more than 24 hours of combined playback. If you’re in need of extra juice, 5-minute Fast Fuel charging gives 1.5 hours of playback when the battery is low.1 To further conserve battery life, Auto On/Off sensors detect when earbuds are idle and automatically enter sleep mode. When you’re ready to use them again, simply put them back in your ears and you’ll be off and running. Now, you can spend less time worrying about charging and more time charging forward.\r\n\r\nJust ask Siri\r\nTalking to your favorite personal assistant is easier than ever. Simply say “Hey Siri” for voice-activated assistance without having to reach for your iPhone.2 Powered by the new Apple H1 headphone chip, Powerbeats Pro deliver a faster and more stable wireless connection to your devices.3\r\n\r\nWireless that works\r\nPowerbeats Pro are ready to go when you are. With Class 1 Bluetooth technology, these bluetooth earbuds offer extended range and fewer dropouts so they stay connected as you keep moving. Each earbud connects independently to your device for better connectivity and freedom of use for music and phone calls. A voice accelerometer and multiple microphones target your voice and filter out external noise. They instantly set up—just open the case and hold near your iPhone—and then automatically connect to your Apple Watch, iPad, or Mac.4\r\n\r\nFind your earbuds\r\nNeed help finding your Powerbeats Pro? When they’re nearby one of your Apple devices, use Find My6 to play a sound to locate them or see your earbuds on a map. If your Powerbeats are lost or missing, the Find My app can still help you track them down using the vast and global Find My network, made up of hundreds of millions of Apple devices. Devices in the Find My network use secure Bluetooth technology to detect your devices nearby and report their approximate location back to you, so you can find them.', 1, NULL, 'active', '2023-05-07 17:22:40', '2023-05-07 17:22:40'),
(398, '9d879dd6-8333-4bf8-86dd-fdff8adc7e35', 'New Sensor Compact Camera Digital Camera Waterproof High Quality', 1, 'CAMERADIGITAL', '21MP 1″ stacked Exmor RS CMOS sensor provides optimal image quality and minimizes rolling shutter artifacts\r\n24mm-equivalent f/4 lens provides a wide view without barrel distortion\r\nUltra-compact lightweight camera body; waterproof to 33′, crushproof under 440 lb, and shockproof to 6.5′\r\nOutputs uncompressed UHD 4K to an external recorder; captures up to 1080p60 internally\r\nHigh-speed sensor readout even at super slow-motion up to 960/1000 fps\r\nS-Log2 gamma setting and multiple picture profiles for image customization\r\nShutter speeds up to 1/32,0000 per second for crisp, clear images\r\nCan record video clips longer than 30 minutes\r\nTimecode sync and control of up to five cameras with one smartphone; control greater than five cameras when connected to Wi-Fi\r\nSony Play Memories app is available in both iOS and Android versions\r\nNTSC and PAL-compatible', 1, NULL, 'active', '2023-05-07 17:31:13', '2023-05-07 17:31:13'),
