(439, '72ef55a8-1fd4-486f-aeca-58d6c295fecd', 'New Apple MacBook Pro 16\'\' (512GB/1TB Intel Core i7, 2.6 GHz, 16 GB) Space Grey Laptop', 1, 'APPLEMACBOOKPRO16', '<p>Graphic details</p><p>Product Description</p><p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td>Model:</td><td>MacBook Pro</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>Release Year:</td><td>2019</td><td>Maximum Resolution:</td><td>3072 x 1920</td></tr><tr><td>Storage Type:</td><td>SSD (Solid State Drive)</td><td>Country/Region of Manufacture:</td><td>China</td></tr><tr><td>RAM Size:</td><td>16 GB</td><td>Operating System:</td><td>Mac OS 11.0, Big Sur</td></tr><tr><td>Brand:</td><td>Apple</td><td>Graphics Processing Type:</td><td>Dedicated Graphics</td></tr><tr><td>Manufacturer Warranty:</td><td>1 year</td><td>Series:</td><td>MacBook Pro</td></tr><tr><td>Most Suitable For:</td><td>Graphic Design</td><td>Processor Speed:</td><td>2.3 GHz</td></tr><tr><td>Product Family:</td><td>MacBook Pro</td><td>Features:</td><td>Magic Keyboard, Backlit Keyboard, Bluetooth, Built-in Microphone, Force Touch Trackpad, Multi-Touch Trackpad, Touch Bar, Touch ID</td></tr><tr><td>Manufacturer Color:</td><td>Silver</td><td>Color:</td><td>Silver</td></tr><tr><td>Processor:</td><td>Intel Core i9 9th Gen.</td><td>Hard Drive Capacity:</td><td>1 TB</td></tr><tr><td>Memory:</td><td>16GB</td><td>MPN:</td><td>MVVK2LL/A</td></tr><tr><td>SSD Capacity:</td><td>1 TB</td><td>GPU:</td><td>AMD Radeon Pro 5500M</td></tr><tr><td>Screen Size:</td><td>16 in</td><td>UPC:</td><td>190199267978</td></tr></tbody></table></figure><p>The Apple 16\" MacBook Pro features a 16\" Retina Display, a Magic Keyboard with a redesigned scissor mechanism, a six-speaker high-fidelity sound system, and an advanced thermal design. This MacBook Pro also features an AMD Radeon Pro 5500M graphics card, a 7nm mobile discrete GPU designed for pro users. With 4GB of GDDR6 VRAM, pro users will be able to tackle GPU-intensive tasks with this MacBook Pro.</p><p>The 16\" Retina Display has a 3072 x 1920 resolution at 226 ppi as well as 500 nits of brightness. It also supports the P3 wide color gamut which allows for more vibrant colors. This ensures true-to-life pictures with realistically vivid details, which are essential for graphic design, color grading, and editing. With True Tone technology, the white balance automatically adjusts to match the color temperature of the light around you for a more natural viewing experience.</p><p>The Magic Keyboard on this MacBook Pro has a redesigned scissor mechanism that delivers 1mm of key travel as well as an Apple-designed rubber dome that stores more potential energy for a responsive key press. There\'s also a physical Esc key and an inverted \"T\" arrangement for the arrow keys. The Touch Bar places controls right at your fingertips and adapts to different apps to provide useful functions without having to navigate complex menus or memorize keyboard shortcuts. Replacing the function keys in the top row of the keyboard, the Touch Bar features a Retina-quality display and supports multi-touch input. The power button contains the Touch ID sensor, so you can quickly log into your MacBook Pro using your fingerprint. You can also use Touch ID to make purchases over the web, thanks to Apple Pay. Touch ID enables a quick, accurate reading of your fingerprint and uses sophisticated algorithms to recognize and match it with the Secure Enclave in the Apple T2 chip with \"Hey Siri\" functionality.</p><p>This MacBook Pro is powered by a 9th Gen 2.3 GHz Intel Core i9 8-Core processor that features a burst speed of up to 4.8 GHz, while 16GB of 2666 MHz DDR4 RAM helps to ensure smooth multitasking and also allows the computer to quickly access frequently used files and programs. The system memory cannot be upgraded.</p><p>For long-term storage of your files, this MacBook Pro is equipped with a 1TB SSD. If you want to add external peripherals, four Thunderbolt 3 ports support bi-directional transfer speeds of up to 40 Gb/s, while also supporting 10 Gb/s USB 3.1 and device charging. Wi-Fi 5 (802.11ac) is built-in for wireless networking, and Bluetooth 5.0 technology will allow you to connect additional compatible peripherals. There is a FaceTime HD webcam.</p><p>This Mac comes preloaded with macOS. Updates can be downloaded for free via the Mac App Store. Please check Apple\'s website for upgrade eligibility.</p><p><strong>Retina Display</strong></p><p>The MacBook Pro features a large 16\" Retina Display with 500 nits of brightness. Featuring a 3072 x 1920 resolution and 226 pixels per inch, the Retina Display delivers nearly 6 million pixels. It also supports the P3 wide color gamut, which features 25% more colors than the commonly used sRGB gamut, for even more vibrant greens and reds. The display is calibrated at the factory for accurate gamma, white point, and primary colors.</p><p><strong>Magic Keyboard</strong></p><p>The Magic Keyboard on this MacBook Pro features a redesigned scissor mechanism that delivers 1mm of key travel. There\'s also a physical Esc key and an inverted \"T\" arrangement for the arrow keys. Combined with the Touch Bar and Touch ID, the Magic Keyboard provides a comfortable, accurate typing experience.</p><p><strong>Advanced Thermal Design</strong></p><p>With a sophisticated fan design, the MacBook Pro features a large impeller with extended blades along with bigger vents, resulting in a 28 percent increase in airflow while the 35 percent larger heat sink ensures more efficient heat dissipation. Together, these advancements in cooling capacity allow the MacBook Pro to sustain up to 12 more watts during intensive workloads than the previous design.</p><p><strong>Higher Fidelity Audio</strong></p><p>The MacBook Pro introduces a redesigned six-speaker, high-fidelity sound system. The Apple-patented force-canceling woofers use dual opposed speaker drivers to reduce unwanted vibrations that distort sound. As a result, music sounds more clear and natural while the bass can go half an octave deeper. An upgraded high-performance mic array delivers a 40 percent reduction in hiss and an improved signal-to-noise ratio. There\'s also a 3.5mm headphone jack if you need to keep things quiet around you.</p><p><strong>Touch Bar</strong></p><p>The Touch Bar replaces the function keys that have long occupied the top of your keyboard with something much more versatile and capable. The multi-touch, Retina-quality display changes automatically based on what you\'re doing, from showing traditional system controls, such as volume and brightness, to more directly interacting with or browsing through content. Intelligent typing features like emoji and predictive text improve the typing experience, and you\'ll be able to customize the Touch Bar to fit your needs. The Touch Bar can also adapt to apps, such as Mail, Safari, Messages, and even third-party apps like Adobe Photoshop, so you\'ll have access to useful functions previously hidden in menus.</p><p><strong>Touch ID</strong></p><p>A Touch ID sensor has been integrated into the power button, so you can quickly log into your account, even when another user is logged in. You can also use it with Apple Pay to securely purchase things over the web.</p><p>True Tone Technology</p><p>With True Tone technology, the display and Touch Bar deliver a more natural viewing experience for design and editing workflows, as well as everyday tasks like browsing the web and writing email.</p><p><strong>Apple T2 Chip</strong></p><p>With the Apple T2 chip, the MacBook Pro delivers enhanced system security with support for secure boot and on-the-fly encrypted storage, and also brings \"Hey Siri\" to the Mac.</p><p><strong>Thunderbolt 3</strong></p><p>Thunderbolt 3 is a hardware interface that utilizes the reversible USB Type-C connector. Doubling the speed of its predecessor, Thunderbolt 3 features a maximum throughput of 40 Gb/s when used with compatible devices. The connector also transmits data via USB 3.1 at up to 10 Gb/s, and dual-bandwidth DisplayPort 1.2 allows you to connect up to two 4K displays simultaneously or one multi-panel 5K display. The MacBook Pro has two ports, sharing one dedicated bus.&nbsp;</p><p>&nbsp;</p><p><strong>In the Box&nbsp;</strong></p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Apple 16 Inch MacBook Pro 1TB 2.3GHz i9 16GB RAM with Touch Bar</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;96W USB Type-C Power Adapter</p><p>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;USB Type-C Charging Cable (6.6\')</p>', 1, NULL, 'active', '2023-05-08 12:58:05', '2023-05-08 12:58:05'),
